import React, { Component } from 'react';

class Header extends Component {
    render () {
        return (
            <div>
                <div>Logo</div>
                <div>Shop</div>
                <div>Gift Card</div>
                <div>Our Fit</div>
                <div>Ask Us</div>
            </div>
        )
    }
}


export default Header;
